import React from 'react';

const Chip = () => {
  {
    props.state.list && (
      <div style={{ marginTop: 1 }}>
        {props.state.list.map(i => {
          return (
            <div
              key={i.id}
              style={{ cursor: 'pointer' }}
              className='chip'
              id={i.Name}
              onClick={props.add}
            >
              {i.Name}
              <i className='close material-icons'>close</i>
            </div>
          );
        })}
      </div>
    );
  }
};

export default Chip;
